object Solution {
    def longestValidSubstring(word: String, forbidden: List[String]): Int = {
        var maxLength = 0
        var start = 0

        while (start < word.length) {
            var valid = true
            var end = start
            while (end <= word.length && valid) {
                val currentSubstring = word.substring(start, end)
                if (forbidden.exists(f => currentSubstring.contains(f))) {
                    valid = false
                } else {
                    maxLength = maxLength max (end - start)
                    end += 1
                }
            }
            start += 1
        }

        maxLength
    }
}
